    "contruct.mt4": "Teilmargin-Modus: Alle Margins werden für die Teilmargin verwendet. Teilmargin ist von Vollmargin getrennt, und die Vollmargin-Liquidation hat keinen Einfluss auf diesen Teil des Vermögens.",
