    "contruct.pl32": "Was ist die Finanzierungsrate?",
    "contruct.pl33": "Der Hauptzweck der Finanzierungsrate besteht darin, die Preisdifferenz zwischen dem ewigen Vertragspreis und dem fairen Marktpreis des zugrunde liegenden Vermögenswerts zu verringern.",
    "contruct.pl34": "Die Finanzierungsgebühren werden alle 8 Stunden abgerechnet. Wenn die Finanzierungsrate positiv ist, zahlen die Long-Positionen den Short-Positionen die Finanzierungsgebühren. Wenn die Finanzierungsrate negativ ist, zahlen die Short-Positionen den Long-Positionen die Finanzierungsgebühren.",
