    "contruct.pl4": "Ohne Berücksichtigung von Gebühren ist der theoretisch maximal mögliche Eröffnungsbetrag oder Ihr verfügbares Guthaben unter dem aktuellen Hebel und dem neuesten Marktpreis der entsprechende Wert.",
    "contruct.pl5": "Kann Short eröffnen",
