    "dp.t26": "Automatische Investition",
    "dp.t27": "Nach Aktivierung wird das System täglich um 18:00 Uhr (UTC+8) Ihr verfügbares Guthaben von Ihrem Kapital- und Finanzkonto in das Tagesgeldkonto überweisen.",
