    "dp.t30": "Zinsberechnung",
    "dp.t31": "Die Zinsprodukte unterstützen sowohl festen Tageszins als auch gestaffelten Tageszins. Die Zinsabrechnung erfolgt täglich um 12:00 Uhr (UTC+8), die Erträge sind in der Basiswährung.",
