    "dp.t34": "Hinweis: Die genauen Tageszinssätze können je nach Markt angepasst werden.",
    "dp.t35": "Rücknahmebedingungen",
    "dp.t36": "Die Zinsprodukte unterstützen T+0 und T+1 als zwei Arten von Gutschriften.",
    "dp.t37": "Wenn Sie T+0 wählen, wird der Anteil innerhalb von 10 Minuten nach Bestätigung der Rücknahme gutgeschrieben, es fällt jedoch eine Rücknahmegebühr von 1% an, und es gibt ein tägliches Rücknahme-Limit.",
