    "entrust.t3": "Limit-Preis",
    "entrust.t30": "Ein 'Take-Profit-Stop-Loss'-Auftrag bedeutet, dass Sie im Voraus den 'Auslöserpreis', 'Auftragspreis' und 'Menge' festlegen. Wenn der aktuelle Preis den Auslöserpreis erreicht, wird der Auftrag zum Auftragspreis platziert, um Ihnen zu helfen, Gewinne zu sichern oder Verluste zu minimieren.",
    "entrust.t31": "Risiko von Slippage bei Marktpreisen",
    "entrust.t32": "Der Preis für die Ausführung von Take-Profit-Stop-Loss-Aufträgen kann nicht garantiert werden und hängt vollständig von der aktuellen Marktsituation ab. Bitte nehmen Sie Gewinne und Verluste schrittweise vor, um größere Slippage zu vermeiden!",
    "entrust.t33": "Risiko, dass Limit-Preise nicht ausgeführt werden",
    "entrust.t34": "Obwohl Limit-Stop-Loss-Orders Preis-Slippage begrenzen können, garantieren sie nicht, dass sie ausgeführt werden! Versuchen Sie, beim Festlegen des Auftragspreises einen angemessenen Abstand zum Auslöserpreis zu lassen, damit die Limit-Orders leichter ausgeführt werden können!",
    "entrust.t35": "Schutz vor Spike-Triggers",
    "entrust.t36": "Um zu verhindern, dass Marktpreise durch Spike-Triggers Stop-Loss auslösen und versehentlich Schäden verursachen, verwenden wir einen glatteren Markierungspreis als Ziel. Wenn der aktuelle Preis zu stark vom Markierungspreis abweicht, wird der Stop-Loss nicht ausgelöst!",
