    "rules.con_c": "1. Laden Sie neue Benutzer ein, sich bei ComeBit zu registrieren, um Belohnungen zu erhalten. Die Anzahl der eingeladenen Freunde pro Konto ist unbegrenzt;",
    "rules.con_c1": "2. Wenn Freunde die Einladung annehmen und Transaktionen durchführen, wird eine entsprechende Gebühr (maximal 20%) als Belohnung zurückgegeben;",
    "rules.con_c2": "3. Der Einladende kann den Rückvergütungsprozentsatz (5%, 10%, 15%) für die eingeladenen Personen auswählen und gemeinsam von den Handelsrückvergütungen profitieren;",
    "rules.con_c3": "4. Spot-Rückvergütungen und Vertragsrückvergütungen laufen parallel, die Provision wird täglich abgerechnet und nach der Abrechnung auf das ComeBit-Konto zurückgegeben.",
    "rules.con_c4": "1. Die Basis für die Handelsrückvergütung = Handelsvolumen * Gebührensatz des entsprechenden Währungspaares - zusätzliche Gebührenrabatte;",
    "rules.con_c5": "2. ComeBit verbietet die Selbstladung mehrerer Konten. Bei nachgewiesenen Verstößen werden die Belohnungen aller betroffenen Konten annulliert;",
    "rules.con_c6": "3. ComeBit behält sich das Recht vor, die Rückvergütungsregeln nach eigenem Ermessen anzupassen und die endgültige Auslegung dieser Aktivität zu genießen.",
