    "bbox.t13": "Cos'è la scatola misteriosa della ricchezza?",
    "bbox.t14": "La scatola misteriosa della ricchezza è un derivato lanciato da ComeBit Exchange per arricchire l'esperienza di investimento degli utenti. Gli utenti possono aprire una scatola misteriosa pagando una certa quantità di criptovaluta, e il 100% vincerà un premio in criptovaluta casuale. Il pool di premi delle scatole misteriose è diviso in pool di premi USDT, i pool sono indipendenti l'uno dall'altro e gli utenti possono scegliere liberamente il pool da cui partecipare.",
    "bbox.t15": "Descrizione della scatola misteriosa",
    "bbox.t16": "Ci sono sei tipi di scatole misteriose: diamante, platino, oro, argento, bronzo e ferro. Ogni scatola misteriosa ha un prezzo di apertura e un premio diversi.",
    "bbox.t17": "Se scegli il pool di premi USDT, il costo e il premio massimo per l'apertura di una scatola misteriosa sono i seguenti:",
    "bbox.t18": "Diamante: paga 128 USDT, massimo 8888 USDT",
    "bbox.t19": "Platino: paga 88 USDT, massimo 3888 USDT",
    "bbox.t2": "Regole del gioco",
    "bbox.t20": "Oro: paga 38 USDT, massimo 1288 USDT",
    "bbox.t21": "Argento: paga 18 USDT, massimo 688 USDT",
    "bbox.t22": "Bronzo: paga 8 USDT, massimo 188 USDT",
    "bbox.t23": "Ferro: paga 1 USDT, massimo 38 USDT",
    "bbox.t24": "Processo di partecipazione",
    "bbox.t25": "Primo passo: seleziona il tipo di pool nella pagina, l'utente può scegliere di entrare nel pool di premi USDT; quindi seleziona il tipo di scatola misteriosa, ci sono vari tipi di scatole misteriose disponibili nella pagina;",
    "bbox.t26": "Secondo passo: l'utente può scegliere di aprire 1 scatola misteriosa o 5 scatole misteriose ogni volta, l'importo pagato per la scatola misteriosa verrà detratto dal conto spot. Se il saldo del conto spot è insufficiente, il sistema fornirà un avviso, a questo punto è possibile effettuare un trasferimento di fondi o ricaricare;",
    "bbox.t27": "Terzo passo: dopo aver aperto la scatola misteriosa, riceverai un premio in criptovaluta casuale, che verrà automaticamente accreditato sul conto spot.",
    "bbox.t28": "※ Il diritto finale di interpretazione di questa attività appartiene a ComeBit.",
