    "newcontract.t59": "Se il mercato è altamente volatile, il prezzo effettivo di esecuzione del take profit/stop loss potrebbe differire dal prezzo al momento dell'attivazione, il take profit/stop loss potrebbe non essere eseguito o non essere completamente eseguito.",
    "newcontract.t6": "Tasso di margine / Inverso",
    "newcontract.t60": "La quantità apribile è limitata da leverage, prezzo, fondi disponibili e massima quantità di apertura della posizione",
    "newcontract.t61": "Spese di margine = Valore della posizione * Tasso di margine",
    "newcontract.t62": "Ogni 8 ore, i detentori di posizioni long e short genereranno spese di margine. Se il tasso di margine è positivo dopo il regolamento, i detentori di posizioni long pagheranno le spese ai detentori di posizioni short. Se il tasso di margine è negativo, i detentori di posizioni short pagheranno le spese ai detentori di posizioni long.",
    "newcontract.t63": "Nota: il tasso di margine fluttua in tempo reale ogni 8 ore in base alle condizioni di mercato. Durante il periodo di regolamento, il valore della posizione sarà utilizzato per calcolare le spese di margine.",
    "newcontract.t64": "Il prezzo di riferimento è determinato dal prezzo dell'indice in tempo reale e dal tasso di margine imminente, riflettendo il prezzo ragionevole attuale di quel contratto. Il prezzo di riferimento è utilizzato per calcolare i profitti e le perdite fluttuanti della posizione e l'attivazione della liquidazione.",
    "newcontract.t65": "Modifica ordine",
    "newcontract.t66": "Inserisci la quantità di ordine",
    "newcontract.t67": "Nota: a causa della volatilità del mercato, la funzione di modifica dell'ordine di annullamento e reinserimento potrebbe non essere eseguita o non essere completamente eseguita.",
    "newcontract.t68": "Modifica ordine",
    "newcontract.t69": "Nota: a causa della volatilità del mercato, la funzione di modifica dell'ordine di annullamento e reinserimento potrebbe non essere eseguita o non essere completamente eseguita.",
