    "rules.con_c": "1. Invita nuovi utenti a registrarsi su ComeBit e ricevi ricompense per commissioni, il numero di amici invitati per singolo account è illimitato;",
    "rules.con_c1": "2. Gli amici che accettano l'invito e effettuano transazioni genereranno una ricompensa per commissioni proporzionale (fino al 20%);",
    "rules.con_c2": "3. L'invitante può scegliere la percentuale di commissione per i livelli inferiori (5%, 10%, 15%), godendo della commissione di transazione insieme all'invitato;",
    "rules.con_c3": "4. Le commissioni spot e le commissioni sui contratti sono parallele, le commissioni vengono liquidate giornalmente e restituite all'account ComeBit.",
    "rules.con_c4": "1. La base della commissione di transazione = importo della transazione * tasso corrispondente della coppia di monete - sconto sulle commissioni aggiuntive;",
    "rules.con_c5": "2. ComeBit vieta l'auto-invito di più account, se scoperto, le ricompense degli account correlati saranno annullate;",
    "rules.con_c6": "3. ComeBit si riserva il diritto di modificare le regole delle commissioni in base alla situazione reale e ha l'ultima parola su questa attività.",
