    "rules.con_c": "1. Invitar a nuevos usuarios a registrarse en ComeBit, disfrutar de recompensas de comisiones, el número de amigos invitados por una sola cuenta es ilimitado;",
    "rules.con_c1": "2. Después de que el amigo acepte la invitación y realice una transacción, se generará una recompensa de comisión correspondiente (hasta el 20%);",
    "rules.con_c2": "3. El invitador puede elegir el porcentaje de comisión de los niveles inferiores (5%, 10%, 15%), y disfrutar de la recompensa de la transacción junto con el invitado;",
    "rules.con_c3": "4. Las recompensas de comisiones de spot y contrato se ejecutan en paralelo, las comisiones se liquidan diariamente y se devuelven a la cuenta de ComeBit.",
    "rules.con_c4": "1. La base de la recompensa de la transacción = monto de la transacción * tasa correspondiente del par de monedas - descuento de comisiones adicionales;",
    "rules.con_c5": "2. ComeBit prohíbe múltiples cuentas auto-invitadas, una vez verificado, las recompensas de las cuentas relacionadas serán canceladas;",
    "rules.con_c6": "3. ComeBit ajustará las reglas de recompensa según la situación real y se reserva el derecho de interpretación final de esta actividad.",
